export const addBild = (artwalkId, bild) => ({
  type: 'ADD_BILD',
  bild: bild,
  artwalkId: artwalkId
});

export const addArtwalk = (id, name, bilds) => ({
  type: 'ADD_ARTWALK',
  id: id,
  name: name,
  bilds: bilds
});

const API_URL = process.env.REACT_APP_API_URL;
